import ProductCard from '../elements/ProductCard'

function Catalog(props) {

  const productsList = props.records.map(record => (
      <>
      <h1>{record.fields.Название}</h1>
      <img src={record.fields.Фото[0].url}/>
      </>
  ))

  return (
    <div className="catalog">
      {productsList}
    </div>
  );
}

export default Catalog
